	public void solve(char[][] bd) {
		if (bd == null || bd.length == 0 || bd[0] == null || bd[0].length == 0)
			return;

		int row = bd.length;
		int col = bd[0].length;
		if (col > 1 && row > 1) {
			for (int i = 0; i < col - 1; i++) {
				// up
				if (bd[0][i] == 'O') {
					search(bd, 0, i);
				}

				// bottom
				if (bd[row - 1][i + 1] == 'O') {
					search(bd, row - 1, i + 1);
				}
			}

			for (int i = 1; i < row; i++) {
				// left
				if (bd[i][0] == 'O') {
					search(bd, i, 0);
				}

				// right
				if (bd[i - 1][col - 1] == 'O') {
					search(bd, i - 1, col - 1);
				}
			}

			for (int i = 0; i < row; i++) {
				for (int j = 0; j < col; j++) {
					if (bd[i][j] == 'Y')
						bd[i][j] = 'O';
					else
						bd[i][j] = 'X';
				}
			}
		}
	}

	private void search(char[][] bd, int i, int j) {
		// if (i < 0 || i >= bd.length || j < 0 || j >= bd[0].length || bd[i][j]
		// != 'O')
		// return;
		// // mark it as been visited.
		// bd[i][j] = 'Y';

		// search(bd, i-1, j);
		// search(bd, i+1, j);
		// search(bd, i, j-1);
		// search(bd, i, j+1);

		if (bd[i][j] == 'O') {
			bd[i][j] = 'Y';

			if (i > 1) {
				search(bd, i - 1, j);
			}
			if (j > 1) {
				search(bd, i, j - 1);
			}
			if (i + 1 < bd.length) {
				search(bd, i + 1, j);
			}
			if (j + 1 < bd[0].length) {
				search(bd, i, j + 1);
			}
		}

	}
